import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (


(<div>

<div class="Panel1"> 

  <input type="text" placeholder="Search Anime" id="DirectorySearch" class="Searchbar"></input>

   </div>

<div class="RenderList"> 

<ul id="Rendered">





</ul>

</div>

</div>)
  );
}

import data from './animearchive.json'

ImportedData = data;

for (const [key, value] of Object.entries(ImportedData)){

var Object = document.createElement("li");
Object.id = (value.ID);

var TextNode = document.createTextNode(value.Pagename);
Object.appendChild(TextNode);

var ElementSender = document.getElementById("Rendered")
ElementSender.appendChild(Object);

var Linker = document.createElement("a");
var LinkerNode = document.createTextNode(value.Pagename);
Linker.appendChild(LinkerNode);
Linker.href = value.Direct;

var LinkedSender = document.getElementById(value.ID);
LinkedSender.appendChild(Linker);

}




export default App;
